export const newsListQuery = async () => {
  const dataList = await fetch(`http://drop-table.tech/news/all`)
    .then((resp) => resp.json())
    .then(({ data }) => data);
  return (dataList || [])
    .map((data, idx) => ({
      id: data?.id,
      preview: {
        title: data?.preview?.title,
        description: `${
          [
            'Значимость этих проблем настолько очевидна, что постоянный количественный рост и сфера нашей активности требует от нас анализа дальнейших направлений развития проекта',
            ' Задача организации, в особенности же рамки и место обучения кадров способствует подготовке и реализации форм воздействия',
            ' Повседневная практика показывает, что новая модель организационной деятельности играет важную роль в формировании ключевых компонентов планируемого обновления',
            ' Задача организации, в особенности же постоянный количественный рост и сфера нашей активности требует определения и уточнения всесторонне сбалансированных нововведений',
            '',
          ][idx % 4]
        }`,
      },
      category: {
        categoryId: data?.preview?.category?.category_id,
        name: data?.preview?.category?.category_name,
        color: [
          '#FA3939',
          '#D2F16B',
          '#646464',
          '#5FE2FF',
          '#FFC121',
          '#5F95FF',
        ][data?.preview?.category?.category_name?.length % 6 || 0],
      },
      sourceName: data?.preview?.source_name,
      socialInfo: {
        likesCount: data?.social_info?.likes,
        isLiked: data?.social_info?.is_liked,
        visitedCount: data?.social_info?.views,
      },
      image:
        // data?.preview?.image ||
        [
          'https://s3-alpha-sig.figma.com/img/9008/04d2/58b56092ed85d7c87873b2183d2da630?Expires=1617580800&Signature=VWvqTJl4-QKTTWv5W1Ydl4AvozIWSnCCKZ5wzX0NIqZ-RgECVT3Gcfms2Adbzx1jDqjVQxG7XmTWnC~U1zQjaRQTn1e7hlWMqmU2AvFQ~Z94tWXWbhcdu4OzwCO6YJfSn4VofmY7w11sgF0QKseNl8v9PRM4-cDdBKNJqAB7nR4jGRSL-JrdjSk72Y5Z9iqBtMlUtHPq7FgfpLShCas4ut75QNO6v5kJLoIJOmCwV5rVdA36CFG3aBraXwcNq0NAEZ6GsNv2HhAxrzdnEyHH81iCccCvmWVTdTmgwoy7qyR0QDPDd2oy8dnHrd6I07A4eAoBWBfnKCUgSvqbRfHk2Q__&Key-Pair-Id=APKAINTVSUGEWH5XD5UA',
          'https://i.pinimg.com/originals/fb/67/30/fb67309239843593d1e1ddd2fb7f5df2.jpg',
          'data:image/jpeg;base64,',
          'https://mostrek.ru/wp-content/uploads/2019/09/Istoricheskij-muzej-v-Moskve-580x385.jpg',
          'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTZWjiFrm4YGGkwrV26MgsszqxvJyKPs1n8yA&usqp=CAU',
          'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTIJvDCE3ocsoV2qr8cjtkG_r8RAMadtvdNrw&usqp=CAU',
          'https://kudamoscow.ru/uploads/bce46363e1aa8913b8f52f9cbba182bd.jpg',
          'https://way2day.com/wp-content/uploads/2017/12/Muzei-Moskvy.jpg',
          'https://dynamic-media-cdn.tripadvisor.com/media/photo-o/08/ec/4f/1b/caption.jpg?w=400&h=400&s=1',
          'https://guruturizma.ru/wp-content/uploads/2016/10/2muzeiestestvistorii.jpg',
          'https://topparki.ru/wp-content/uploads/2018/12/gorky_park_tb.jpg',
          'https://kudago.com/media/images/place/6a/a5/6aa5474847de799c7937292755109e9e.jpg',
        ][idx % 11],
      content: (data?.content || []).map(({ result }) => ({
        type: result?.type,
        payload:
          result?.type === 'location'
            ? {
                name: JSON.parse(result?.payload)?.name,
                image: JSON.parse(result?.payload)?.images?.[0],
                isFavorite: JSON.parse(result?.payload)?.is_faivorite,
              }
            : result?.payload,
      })),
    }))
    .filter((data) => data.category.name?.length <= 18);
};
